    "Grassland Expansion and Establishment Plan for Seatuck National Wildlife Refuge
    2004",nt"tracking_summary": {ntt"total": 1,ntt"recent": 1nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2016-07-27T23:04:31.562132",nt"name":
    "grassland-expansion-and-establishment-plan-for-seatuck-national-wildlife-refuge-2004",nt"isopen":
    false,nt"url": null,nt"notes": "This detailed plan provides methods and
    a time frame for creating 40-60 acres of warm-season grassland at Seatuck National
    Wildlife Refuge using seed sources, both from on-site and from the nearby Sayville
    Grasslands. It provides specific recommendations for seed collection and handling,
    species to be selected, invasive species management, prescribed burning and mechanical
    treatment over the next five years. This plan provides a five-year program, but
    it is likely the restoration will take longer. Seatuck NWR was formerly an estate,
    planted with numerous exotic species. The site contains areas that represent potentially
    restorable grasslands.",nt"license_title": "License Not Specified",nt"extras":
